import { Box, Stack } from "@chakra-ui/react";


function Signin(){

    return(
        <div className="Signin">
            <Stack width="100%" margin="auto">
                <Box width="40" height="500px" margin="auto" border="solid 1px red" >

                </Box>
            </Stack>

        </div>
    )
}

export default Signin;
